import React, { Component } from "react";
import axios from "axios";
import Comuna from "../Create/Comuna";


class getComunas extends Component{

    state={
        Comuna:[]
    }

    componentIDMount(){
        axios.get('http://localhost:4000/API/comuna')
        .then(response =>{
            this.setState({
                Comuna : response.data
            })
        })

    }

    render(){

        return(
            <React.Fragment>
                <div className="container">
                    <table className="table table-hover">
                    <thead>
                            <tr>
                            <th scope="col">ID</th>
                            <th scope="col">Nombre</th>
                            <th scope="col">Id Region</th>
                            </tr>
                        </thead>
                        <tbody>
                        {this.state.Comuna.map((value, index)=>{
                            return(
                                <tr key={index}>
                                    <td>{value.id_com}</td>
                                    <td>{value.nom_com}</td>
                                    <td>{value.id_rgn}</td>
                                </tr>
                            )
                        })}
                        </tbody>
                    </table>
                </div>


            </React.Fragment>
        );       

    }
}

export default getComunas
